import React, {Component} from 'react';
import "./_basket_nav.scss"

class BasketNav extends Component
{
    render() {
        return (
            <>
                <nav className="basket">
                    <div className="container">
                        <ul>
                            <li>Koszyk</li>
                            <li>Adres dostawy</li>
                            <li>Podsumowanie</li>
                        </ul>
                    </div>
                </nav>
            </>
        )
    }
}

export default BasketNav;
